// Normalized helper: convert legacy keys to camelCase keys
type NormalizedRawItem = {
  approvalDate: string;
  drugName: string;
  submission: string;
  activeIngredients: string;
  company: string;
  submissionClassification: string;
  submissionStatus: string;
};

const normalizeRawItem = (item: any): NormalizedRawItem => ({
  approvalDate: item["Approval Date"] ?? "",
  drugName: item["Drug Name"] ?? "",
  submission: item["Submission"] ?? "",
  activeIngredients: item["Active Ingredients"] ?? "",
  company: item["Company"] ?? "",
  submissionClassification: item["Submission Classification *"] ?? "",
  submissionStatus: item["Submission Status"] ?? "",
});

// Use this export wherever you need the new keys
export const sampleRawDataNormalized: NormalizedRawItem[] = (sampleRawData as any[]).map(normalizeRawItem);